sourcesContent:
import styled from "styled-components";

export const PageStyled = styled.div`
    h6 {
        font
        text-align: center;
        justify-content: center;
        color: blue;
    }
`;

export const Map = styled.div`
    margin: 0;
    padding: 0;
    //border: 1px solid blue;
    border-radius: 10px;
    box-shadow: 0 0 11px rgba(33,33,33,.2);
`;
